    data: |
      SELECT + col0, col2 AS col1 FROM tab0 WHERE ( 26 NOT BETWEEN - col0 + - col0 + - + col1 + - + ( + + col2 ) * + - col0 AND NULL );
  - name: tab0

outputs:
